import React, {Component} from 'react';
import Host2 from "./Host2";

class Host2S extends Component {
    render() {
        return (
            <div className="container marketing" data-aos="fade-up">
            <div className="row">
                <Host2 classicon="fab fa-wordpress" tieude="WordPress " mota="WordPress Hosting và tốc độc blog là một trong những yếu tố quan trọng để phát triển web thành công. Nhờ vào công nghệ tối ưu cache của wordpress hosting trên server, RNode đã thành công trong việc cung cấp wordpress hosting nhanh nhất với giá cả phải chăng nhất. Hãy để chúng tôi giúp bạn bắt đầu một WordPress website chất lượng, mà không phải tốn kém cho phí hosting! i"/>
                <Host2 classicon="fas fa-money-check-alt" tieude="Tiết kiệm đáng kể" mota="Hosting giá rẻ với chất lượng cao cấp. Được sự tin dùng bởi rraast nhiều khách hàng, RNode là nhà cung cấp dẫn đầu trong ngành web hosting giá rẻ và là nhà cung cấp web hosting tốt nhất năm 2018 sự cân bằng tối ưu giữa chất lượng và giá cả. Kể cả dịch vụ web hosting miễn phí của RNode, được dành riêng cho người mới bắt đầu, là nền tảng web hosting công nghệ đám mây được ưa chuộng nhất trên thế giới trong thời gian qua. "/>
                <Host2  classicon="fas fa-rocket" tieude="Tốc độ cao" mota="Máy chủ sử dụng CPU thế hệ mới nhất của Intel và công nghệ lưu trữ SSD raid 10 nhanh và an toàn dữ liệu nhất"/>
            </div>
            </div>
        );
    }
}

export default Host2S;
